using System;
using UnityEngine;
using UnityEngine.UI;

public class ImagetoBase64 : MonoBehaviour
{
    public string base64String = "";
    public RawImage imageRenderer; 

    private void Start()
    {
        if (!string.IsNullOrEmpty(base64String))
        {
            Texture2D texture = Base64ToTexture2D(base64String);
            if (texture != null)
            {
                imageRenderer.material.mainTexture = texture;
            }
            else
            {
                Debug.LogError("Failed to convert base64 to Texture2D.");
            }
        }
    }

    private Texture2D Base64ToTexture2D(string base64)
    {
        try
        {
            byte[] bytes = Convert.FromBase64String(base64);
            Texture2D texture = new Texture2D(1, 1); 
            if (texture.LoadImage(bytes))
            {
                return texture;
            }
            else
            {
                Debug.LogError("Failed to load image bytes into Texture2D.");
                return null;
            }
        }
        catch (Exception ex)
        {
            Debug.LogError("Error converting base64 to Texture2D: " + ex.Message);
            return null;
        }
    }
}
